    aiAnalyzeResult: undefined,
    aiAnalyzeLoading: false,
  }

  //智能分析
  async onAiAnalyze(e, record) {
    this.setState({ aiAnalyzeLoading: true, aiAnalysisVisible: true, aiAnalyzeResult: undefined, });
    const aiAnalyzeResult = await this.dataSourceMap.analyzeBackup.load({
      backupId: record.id,
    })
