    const { initialBackupList, searchKey, filtersRepo, filtersAuto, filtersType, filtersStatus, filtersEngine } = this.state;
    const backupList = this.applyFilters(initialBackupList, searchKey, filtersRepo, filtersAuto, filtersType, filtersStatus, filtersEngine);
    this.setState({ backupList });
