    this.setState({
      filtersRepo: value.length > 0 ? value : null
    }, () => {
      if (value.length < 1) {
        this.search()
      }
    })
  }

  applyFilters(list, searchKey, filtersRepo, filtersAuto, filtersType, filtersStatus, filtersEngine) {
