    const _res = res?.items || [];
    const backupRepos = [...new Set(_res.map(item => item.backupRepo).filter(Boolean))];
    const repoOptions = backupRepos.map(item => ({ label: item, value: item }));
    const statusOptions = this.utils.getFilters(_res, "status")?.status.map(item => ({ text: this.i18n(`${item.text}`), value: item.value, })).filter(n => n.value !== '');
    const filtersStatus = this.utils.params?.status ? typeof (this.utils.params?.status) == 'string' ? [this.utils.params?.status] : this.utils.params?.status : [];
    const _sortItems = filtersStatus.length > 0 ? _res.filter(n => filtersStatus.includes(n?.status)) : _res;
