        danger: true,
      },
      onOk: async () => {
        await this.dataSourceMap.deleteBackup.load({
          backupId: record.id
        });
        this.getFilterList();
      }
    })
  }

  //查看文件
  async getFile(e, record) {
    this.getBackupList();
    const info = await this.dataSourceMap.getBackup.load({
      backupId: record.id
    });
    if (info?.backupType == 'Full' && info?.status !== 'Completed'){
      this.utils.message.warning(`${this.i18n('noCompleted')}`);
    }else{
      this.setState({
        fileVisible: true,
        filesLoading: true,
      })
      const files = await this.dataSourceMap.viewBackup.load({
        backupId: record.id,
        body: {
          filepaths: info.engine == 'oceanbase' && JSON.parse(info?.extras)?.[0]?.archivePath ? [
            JSON.parse(info?.extras)?.[0]?.archivePath,
            info?.path,
          ] : [info?.path]
        }
      });
      this.setState({
        files,
        info,
        filesLoading: false
      })
    }
  }

  //一键下载
  async onDownload(e, record) {
    const { info } = this.state;
    this.setState({ downLoading: true })
    const files = await this.dataSourceMap.downloadBackup.load({
      backupId: record ? record.id:  info?.id,
    });
    if (files){
      this.onFileCancel()
      const url = URL.createObjectURL(files);
      const a = document.createElement('a');
      a.href = url;
      const mimeType = files.type;
      let fileExtension = 'zip'; // 默认扩展名
      if (mimeType) {
        switch (mimeType) {
          case 'application/zip':
            fileExtension = 'zip';
            break;
          case 'application/pdf':
            fileExtension = 'pdf';
            break;
          case 'text/plain':
            fileExtension = 'txt';
            break;
          default:
            fileExtension = 'bin'; // 默认扩展名
        }
      }
      a.download = `${record ? record.name : info?.name}.${fileExtension}`;
      document.body.appendChild(a);
      a.click();
      a.remove();
      URL.revokeObjectURL(url);
    }else{
      this.utils.message.error(this.i18n('failed'))
      this.setState({ downLoading: false })
    }
  }
  onFileCancel() {
    this.setState({
      files: [],
      info: null,
      fileVisible: false,
      downFileLoading: false,
      downLoading: false,
      selectedRowKeys: null
    })
  }
  expandableRowExpandable(record) {
    return true;
  }
  onRowSelection(selectedRowKeys, selectedRows) {
    this.setState({
      selectedRowKeys,
      selectInfo: selectedRows
    })
  }
  //下载选中文件
  async onDownloadFile(e) {
    const { info, selectedRowKeys, selectInfo  } = this.state;
    this.setState({ downFileLoading: true })
    const files = await this.dataSourceMap.downloadMutipleBackups.load({
      backupId: info?.id,
      body: {
        filepaths: selectedRowKeys
      }
    });
    if(files){
      this.onFileCancel()
      const url = URL.createObjectURL(files);
      const a = document.createElement('a');
      a.href = url;
      if (selectedRowKeys?.length > 1) {
        a.download = `${info.sourceCluster}-binlog.zip`;
      } else {
        a.download = selectInfo?.[0]?.filename;
      }
      document.body.appendChild(a);
      a.click();
      a.remove();
      URL.revokeObjectURL(url);
    }else{
      this.utils.message.error(this.i18n('failed'))
      this.setState({ downFileLoading: false })
    }
  }

  //备份详情信息
  async getClusterBackup(e, record) {
    const info = await this.dataSourceMap.getBackup.load({
      backupId: record.id
    });
    this.setState({ backupInfo: info, visible: true })
  }
  onCancel() {
    this.setState({ backupInfo: {}, visible: false })
  }

  componentDidMount() {
    this.setState({ backupsListLoading: true })
    this.getBackupList();
  }

}

